import { useTheme } from '@material-ui/core'
import React from 'react'
 
const LangWrapper = ({children}) => {
  const theme = useTheme()
  console.log('theme', theme)
  return (
    <div style={{...theme.langStyles}}>
      {children}
    </div>
  )
}

export default LangWrapper
